content:
역시 사랑은 타이밍이지
매생이 나타나기 전에 둘이 사겼으면 좋았을텐데ㅠㅠ
이 만화 제목이 매생이가 나타났다라는게 함정;

둘째형아 어릴때 보여주세요!! 단호도 같이면 더 좋아요 어린 매생이들.ㅠㅠ
라이쿤 13살때얘기 나왔는데 매생이말고 사람으로 보고싶어요!!
긴팔 셔츠에 도련님처럼 반바지 입은거요!! 어린라이쿤&gt;.&lt;

1. 작가님은 매생이를 작품의 메인 캐릭터로 잡으신 뒤에 뭔가 애착같은게 생겼나요?? 막 매생이국이 더 좋아졌다거나!ㅋㅋㅋ 매생이만 하면 흠칫! 한다거나요!
2. 얀데레 단호 보여주세요... 순둥순둥한 얀데레가 보고 싶어요... 지금의 단호+집착으로 치명적인 눈빛의 단호가 보고 싶어요..어어유유유ㅠㅠㅠㅠㅠ &quot;도형씨 나만 봐줘요!&quot; 하면서 귀엽고 섹시한 눈빛의 단호가 보고싶어요ㅠㅠㅠㅠㅠㅠ
//아니면 화면 밖으로 나오고 싶어하는 단호요! 막 낑낑대면서 폰 화면 밖으로 나가고 싶어하는 단호요! 해주시면 폰 배경화면으로 고이 모시겠습니다♡

왕~ 벚꽃 구경~ 소풍 이뻐요~&gt;_&lt; 
축전들도 퀄리티 대박~ 다 이뻐요 &gt;_&lt;b 
오청 작가님 푹 쉬시고 6월에 만나요~
